import React from 'react';
import './Course.css'
const Course = (props) => {
    const {name, price,description, sessions,img} = props.course;
    return (
        <div className="container course-info">
            <img src={img} alt="" className="img-fluid image-course"></img>
            <h4 className="price rounded-circle">${price}</h4>
            <h3 className="course-name mt-5">{name}</h3>
            <p>{description}</p>
            <div className="mt-3 ">
            <p>{sessions} sessions</p>
            
            </div>
        </div>
    );
};

export default Course;
